import React from "react";

function DeleteQuizPopup() {
  return (
    <div
      style={{
        height: "38vh",
        width: "55vw",
        marginTop: "30vh",
        marginLeft: "2vw",
        backgroundColor: "pink",
        borderRadius:"10px"
      }}
    >
      <h1>Delete</h1>
    </div>
  );
}

export default DeleteQuizPopup;
